import React from "react";

export default class SubmitReportToBack extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            graphName: this.props.graphName,
            predictionType: this.props.predictionType,
            itemORcustomerName: this.props.itemORcustomerName,
            dates: this.props.dates,
            dataLabel: this.props.dataLabel,
            data: this.props.data,
            colors: this.props.colors,
            xAxisLabel: this.props.xAxisLabel,
            yAxisLabel: this.props.yAxisLabel,

            transactionData: this.state.transactionData,
            customerInfo: this.state.customerInfo,
            inventoryInfo: this.state.inventoryInfo,
            graph: this.state.graph,
            gridlines: this.state.gridlines,

            response: "",
            fetchDone: false,
        }
    }

    componentDidMount() {
        fetch('http://localhost:8080/getGeneralGraph', {
            method: 'GET',
            headers: {
                'graphName': this.props.graphName,
                'predictionType': this.props.predictionType,
                'itemORcustomerName': this.props.itemORcustomerName,
                'dates': this.props.dates,
                'dataLabel': this.props.dataLabel,
                'data': this.props.data,
                'colors': this.props.colors,
                'xAxisLabel': this.props.xAxisLabel,
                'yAxisLabel': this.props.yAxisLabel,

                'transactionData': this.state.transactionData,
                'customerInfo': this.state.customerInfo,
                'inventoryInfo': this.state.inventoryInfo,
                'graph': this.state.graph,
                'gridlines': this.state.gridlines,
            }})
            .then(res => res.json())
            .then(jsonResponse => {
                this.setState({
                    response: jsonResponse,
                })
                console.log("fetch was done")
                console.log(this.state)
                this.setState({fetchDone: true})
            })
            .catch(function(error) {
                console.log('There has been a problem with your fetch operation: ' + error.message);
                throw error;
            })
    }

    render() {
        return(
            <div>

            </div>
        );
    }
}
